const changelog = [{
  "version": "2.28.1",
  "date": "2022-01-14",
  "bugfix": ['<p>Fixed a <code>bug</code> in the <code>Input</code> component where clicking the clear icon edge area did not clear the text.(<a href="https://github.com/arco-design/arco-design/pull/438">#438</a>)</p>\n', '<p>Fixed the problem that the size of <code>searchButton</code> was not adjusted under different sizes of <code>Input.Search</code>.(<a href="https://github.com/arco-design/arco-design/pull/438">#438</a>)</p>\n']
}, {
  "version": "2.28.0",
  "date": "2022-01-07",
  "bugfix": ['<p>Fix the bug that the <code>onChange</code> is not triggered when the <code>Input</code> component enters Chinese and selects the auto-completion option directly.(<a href="https://github.com/arco-design/arco-design/pull/407">#407</a>)</p>\n']
}, {
  "version": "2.23.0",
  "date": "2021-09-27",
  "feature": ["<p>The <code>Input</code> component <code>maxLength</code> supports the <code>errorOnly</code> mode. When exceeding <code>maxLength</code>, user input will not be restricted, but error status will be displayed</p>\n"]
}, {
  "version": "2.18.0",
  "date": "2021-07-02",
  "attention": ["<p><code>Input.Group</code>: Group -&gt; InputGroup</p>\n", "<p><code>Form.Item</code>: Item -&gt; FormItem</p>\n", "<p><code>Menu.Item</code>: Item -&gt; MenuItem</p>\n", "<p><code>Timeline.Item</code>: Item -&gt; TimelineItem</p>\n", "<p><code>Tree.Node</code>: Node -&gt; TreeNode</p>\n", "<p>When you set both <code>allowClear</code> and <code>props.className</code>, the className will be incorrectly applied to the inner input tag. <strong>Sorry this change may cause breaking changes, please pay attention</strong>.</p>\n"]
}, {
  "version": "2.17.3",
  "date": "2021-06-24",
  "bugfix": ["<p>Fix the issue that <code>Input.Search</code> does not trigger <code>onPressEnter</code>.</p>\n"]
}, {
  "version": "2.16.0",
  "date": "2021-05-28",
  "bugfix": ["<p>Fix the problem that the <code>Input</code> style fails to compile in less 4.x.</p>\n"]
}, {
  "version": "2.15.3",
  "date": "2021-05-21",
  "bugfix": ["<p>Fix the bug that the <code>Input</code> tag rendered in the <code>footer</code> of the <code>Cascader</code> component cannot be focused.</p>\n"]
}, {
  "version": "2.15.2",
  "date": "2021-05-14",
  "bugfix": ["<p>Fix the bug that the search button on the right is not disabled when <code>Input.Search</code> is disabled.</p>\n"]
}, {
  "version": "2.13.2",
  "date": "2021-04-01",
  "style": ["<p>Adjust the left and right padding styles of <code>Input</code> components of different sizes.</p>\n", "<p>Fix the problem that the height of the input box becomes 100% of the height of the parent element when the height of the parent element is set for the <code>Input</code> component and <code>allowClear</code> is set.</p>\n"]
}, {
  "version": "2.13.0",
  "date": "2021-03-26",
  "bugfix": ["<p>Fix the bug that the content in the input box cannot be selected by the mouse when the <code>Input</code> component uses <code>addBefore</code>.</p>\n"]
}, {
  "version": "2.9.1",
  "date": "2021-02-20",
  "bugfix": ["<p>When the <code>Input.Search</code> component is disabled, clicking the search icon still triggers the <code>onSearch</code> callback bug.</p>\n"]
}, {
  "version": "2.8.2",
  "date": "2021-01-29",
  "style": ["<p>Fix the disabled style of <code>Input</code> not working in Safari.</p>\n"]
}, {
  "version": "2.8.1",
  "date": "2021-01-28",
  "bugfix": ["<p>Fixed the bug that the <code>Input</code> component introduced full icons, which caused the on-demand loading to fail.</p>\n"]
}, {
  "version": "2.8.0",
  "date": "2021-01-22",
  "style": ["<p>Fix the issue that the split line style of the prefix and suffix of the <code>Input</code> component is lost.</p>\n"]
}];
